<h2 id="toc_0">接口更新说明文档</h2>

<table>
<thead>
<tr>
<th>日期</th>
<th>具体说明</th>
</tr>
</thead>

<tbody>
<tr>
<td>2016-07-10</td>
<td>修改用户查询接口(新增部门查询)； <br> 新增用户模块获取部门数据接口。</td>
</tr>
<tr>
<td>2016-06-24</td>
<td>完善岗亭模块接口 加入 <code>isCheck</code>, <code>isTempIn</code> , <code>isTempOut</code>, <code>cardRights</code> 字段。</td>
</tr>
<tr>
<td>2016-06-20</td>
<td>初定岗亭模块接口和设备接口。</td>
</tr>
<tr>
<td>2016-06-18</td>
<td>1. 车卡添加搜索功能; <br> 2. 新增换卡接口。</td>
</tr>
<tr>
<td>2016-06-13</td>
<td>1. 车卡模块中所有的 <code>boxRight</code> 改为 <code>boxDoorsRight</code> 因为卡是对应岗亭口不是岗亭；<br>2. 新增获取岗亭口(在岗亭模块中可查看)接口；<br> 3. 获取发行需要的数据接口改为 <code>value</code> 和 <code>name</code> 的形式，并增加了 <code>所有月卡的类型</code> 和 <code>停车卡的状态</code>；<br> 4. 查看车辆信息接口新增通告车牌获取车辆信息；<br> 5. 完善 <code>岗亭口</code> 接口。</td>
</tr>
<tr>
<td>2016-06-10</td>
<td>添加分页功能，如果单单带有page参数默认获取15条数据, 如果还带有perPage参数可以规定获取的条数。</td>
</tr>
<tr>
<td>2016-06-06</td>
<td>1. 车卡模块中去掉所有接口的 <code>cardNo</code> 参数(不需要做IC卡了); <br> 2. 车卡模块中 <code>parkCardTypeName</code> 改为 <code>cardTypeId</code>; <br> 3. 车卡模块 <code>POST</code> 请求参数，改为如果车牌存在则传 <code>carId</code> ,不存在则不用传; <br> 4. 车卡模块 <code>carType</code> 改为 <code>carTypeId</code>; <br> 5. 车卡模块新增接口 添加 <code>carLocId</code>(车牌所属地Id); <br> 6. 车卡模块新增接口 的<code>carType</code> 改为 <code>carTypeId</code>; <br> 7. 新增 <code>获取发行需要的数据</code> 接口; <br> 8. 暂时删除总卡的接口。</td>
</tr>
<tr>
<td>2016-06-03</td>
<td>用户模块查看未派发车卡用户接口。</td>
</tr>
<tr>
<td>2016-06-02</td>
<td>初步完成车卡模块接口,车辆模块查看接口。</td>
</tr>
<tr>
<td>2016-05-29</td>
<td>统一接口字段 <code>createdData</code> 改为 <code>createdDate</code>, 统一接口字段 <code>updatedData</code> 改为 <code>updatedDate</code>, 并且由时间戳统一改为 <code>Y-m-d H:i:s</code> 格式(即2016-01-01 10:00:00)。</td>
</tr>
<tr>
<td>2016-05-28</td>
<td>1. 权限相关接口(查看角色接口、权限查看接口、操作者登录接口)新增 <code>parentId</code> 接口；<br> 2. 新增角色接口响应新增返回roleId；<br> 3. 新增操作者接口响应新增返回operatorId。</td>
</tr>
<tr>
<td>2016-05-27</td>
<td>初步完成角色模块、操作者模块、权限模块接口。</td>
</tr>
</tbody>
</table>


